import React from "react";
import { Route, Switch, withRouter } from "react";

import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <h1>hello i am here</h1>
        <Switch>
          <Route
            path="/items"
            render={routerProps => (
              <Main logOutHandler={this.logoutHandler} user={this.state.user} />
            )}
          />
          <Route
            path="/me"
            render={routerProps => {
              console.log("routerProps", routerProps);
              return (
                <UsersContainer
                  user={this.state.user}
                  title="Caravan"
                  logo="truck"
                  color="primary"
                  blabla={this.logoutHandler}
                  logoutHandler={this.logoutHandler}
                />
              );
            }}
          />
          <Route
            path="/signup"
            render={routerProps => (
              <Signup
                onCreateUserHandler={this.onCreateUserHandler}
                title="Caravan"
                logo="truck"
                color="primary"
              />
            )}
          />
          <Route
            path="/login"
            render={routerProps => (
              <Login
                onLoginHandler={this.onLoginHandler}
                title="Caravan"
                logo="truck"
                color="primary"
              />
            )}
          />

          <Route
            path="/about"
            render={routerProps => (
              <About title="Caravan" logo="truck" color="primary" />
            )}
          />

          <Route
            path="/"
            render={routerProps => (
              <LandingPage title="Caravan" logo="truck" color="primary" />
            )}
          />
        </Switch>
      </div>
    );
  }
}

export default withRouter(App);
